-- Creating Tables

-- Subject Table
CREATE TABLE IF NOT EXISTS subs(
    id SERIAL,
    sub_name TEXT NOT NULL,
    PRIMARY KEY (id)
);

-- Teacher Table
CREATE TABLE IF NOT EXISTS teachers (
    id SERIAL,
    teacher_name text NOT NULL,
    PRIMARY KEY (id)
);

-- No need to create seprate table
-- Teacher's Subjects can be taken from classes table
-- Classes table will show current working subject with class (section) details
-- -- Teacher's Subjects Array Table
