-- Grade/Standard Table
CREATE TABLE IF NOT EXISTS grades (
    id SERIAL,
    -- Standard
    grade_no INT NOT NULL UNIQUE,
    -- Subjects ID's
    sub1_id INT NOT NULL,
    sub2_id INT NOT NULL,
    sub3_id INT NOT NULL,
    sub4_id INT NOT NULL,
    sub5_id INT NOT NULL,
    -- Optional Subjects ID's
    osub1_id INT NOT NULL,
    osub2_id INT NOT NULL,
    osub3_id INT NOT NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (sub1_id) REFERENCES subs(id),
    FOREIGN KEY (sub2_id) REFERENCES subs(id),
    FOREIGN KEY (sub3_id) REFERENCES subs(id),
    FOREIGN KEY (sub4_id) REFERENCES subs(id),
    FOREIGN KEY (sub5_id) REFERENCES subs(id),
    FOREIGN KEY (osub1_id) REFERENCES subs(id),
    FOREIGN KEY (osub2_id) REFERENCES subs(id),
    FOREIGN KEY (osub3_id) REFERENCES subs(id)
);

-- Class Table
CREATE TABLE IF NOT EXISTS classes (
    id SERIAL,
    section CHAR NOT NULL DEFAULT 'A',
    grade_no INT NOT NULL,
    -- Teachers ID's
    sub1_teacher_id INT NOT NULL,
    sub2_teacher_id INT NOT NULL,
    sub3_teacher_id INT NOT NULL,
    sub4_teacher_id INT NOT NULL,
    sub5_teacher_id INT NOT NULL,
    -- Optinal Subject Teachers ID's
    osub1_teacher_id INT NOT NULL,
    osub2_teacher_id INT NOT NULL,
    osub3_teacher_id INT NOT NULL,
    PRIMARY KEY (id),
    -- Perviously was using grade_id which was useless
    FOREIGN KEY (grade_no) REFERENCES grades(grade_no),
    FOREIGN KEY (sub1_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (sub2_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (sub3_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (sub4_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (sub5_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (osub1_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (osub2_teacher_id) REFERENCES teachers(id),
    FOREIGN KEY (osub3_teacher_id) REFERENCES teachers(id)
);

-- Students Table
CREATE TABLE IF NOT EXISTS students (
    id SERIAL,
    student_name TEXT NOT NULL,
    class_id INT NOT NULL,
    osub1_id INT,
    osub2_id INT,
    PRIMARY KEY (id),
    FOREIGN KEY (class_id) REFERENCES classes(id),
    FOREIGN KEY (osub1_id) REFERENCES subs(id),
    FOREIGN KEY (osub2_id) REFERENCES subs(id)
);

